import datetime
import logging
from dataclasses import dataclass
from typing import List

# Initialize logging
logging.basicConfig(level=logging.INFO)

@dataclass
class Submission:
    id: int
    status: str
    publish_status: str
    created_at: datetime.datetime

class FABS:
    def __init__(self):
        self.submissions = []
        self.validations = {}
        self.flexfields = {}

    def add_submission(self, submission: Submission):
        self.submissions.append(submission)

    def update_publish_status(self, submission_id: int, new_status: str):
        for submission in self.submissions:
            if submission.id == submission_id:
                submission.publish_status = new_status
                logging.info(f"Updated publish status for submission {submission_id} to {new_status}")
                break

    def process_deletions(self, deletion_date: str):
        logging.info(f"Processing deletions for date {deletion_date}")

