class ErrorFile:
    def __init__(self, filename: str):
        self.filename = filename
        self.errors = []

    def add_error(self, error: str):
        self.errors.append(error)

    def save(self):
        with open(self.filename, 'w') as f:
            for error in self.errors:
                f.write(error + '\n')

